/**
 * Imprime PDF para resumen de asistencias.
 * @param resume
 * @param attendances
 * @param attendancesResume
 */
export function exportAttendancesPDF(resume, attendances, attendancesResume) {
    let moment = require('moment')

    if (process.browser) {
        let pdfMake = require('pdfmake/build/pdfmake.js')
        let pdfFonts = require('pdfmake/build/vfs_fonts.js')
        pdfMake.vfs = pdfFonts.pdfMake.vfs

        let doc = {
            info: {
                title: 'ATT-' + moment().format('DD.MM.YYYY')
            },
            pageSize: 'LETTER',
            pageMargins: [ 40, 60, 40, 60 ],
            styles: {
                headerTitle: {
                    fontSize: 14,
                    bold: true,
                    italics: false,
                    alignment: 'center'
                },
                headerSubTitle: {
                    fontSize: 11,
                    bold: false,
                    italics: false,
                    alignment: 'center'
                },
                topSpace: {
                    margin: [0, 0, 0, 40]
                },
                tableHeader: {
                    fontSize: 11,
                    bold: true,
                    italics: false,
                    alignment: 'left'
                },
                tableValue: {
                    fontSize: 10,
                    bold: false,
                    italics: false,
                    alignment: 'left'
                },
                tableTitle: {
                    fontSize: 10,
                    bold: true,
                    italics: false,
                    alignment: 'left',
                    margin: [0, -10, 0, 5]
                },
                informationBaseline: {
                    margin: [0, 0, 0, 20]
                },
                table: {
                    margin: [0, 0, 0, 30]
                },
                center: {
                    alignment: 'center'
                },
                right: {
                    alignment: 'right'
                },
                bold: {
                    bold: true
                }
            },
            content: []
        }

        generateAttendancesPDF(resume, attendances, attendancesResume, doc)

        pdfMake.createPdf(doc).open()
    }
}

/**
 * Organiza y genera contenido del documento.
 * @param resume
 * @param attendances
 * @param attendancesResume
 * @param doc
 */
function generateAttendancesPDF(resume, attendances, attendancesResume, doc) {
    setHeader(resume, attendances, doc)
    setResume(attendancesResume, doc)
    setAttendances(attendances, doc)
}

function setHeader(resume, attendances, doc) {
    doc.content.push({
        columns: [
            // Primera columna
            {
                width: '*',
                text: [
                    { text: 'RESUMEN DE ASISTENCIAS Y TOTALES' + '\n', style: 'headerTitle' },
                    { text: 'PERIODO: ' + resume.start.format('DD.MM.YYYY') + ' - ' + resume.end.format('DD.MM.YYYY'), style: 'headerSubTitle' }
                ]
            },

            // Segunda columna logo
            {
                image: 'data:image/png;base64,',
                width: 150
            }
        ],
        columnGap: 20
    })
}

function setResume(attendancesResume, doc) {
    doc.content.push({ text: '', style: 'topSpace' })
    doc.content.push({
        text: 'RESUMEN POR TRABAJADOR (INCLUYE TOTAL)',
        style: 'tableTitle'
    })
    doc.content.push({
        style: 'informationBaseline',
        table: {
            widths: [ '*' ],
            heights: [0],
            body: [
                [
                    { text: '', border: [false, false, false, true] }
                ]
            ]
        }
    })

    const content = {
        layout: {
            fillColor: function (rowIndex, node, columnIndex) {
                return (rowIndex !== 0 && rowIndex % 2 === 0) ? '#f5f5f5' : null
            }
        },
        style: 'table',
        table: {
            headerRows: 1,
            widths: [ 'auto', '*', 'auto', 'auto', 'auto', 'auto', 90 ],
            heights: [15],
            body: [
                [
                    { text: 'Item', style: 'tableHeader', border: [false, false, false, true] },
                    { text: 'Trabajador', style: 'tableHeader', border: [false, false, false, true] },
                    { text: 'Precio N.', style: 'tableHeader', border: [false, false, false, true] },
                    { text: 'Precio E.', style: 'tableHeader', border: [false, false, false, true] },
                    { text: 'Horas N.', style: 'tableHeader', border: [false, false, false, true] },
                    { text: 'Horas E.', style: 'tableHeader', border: [false, false, false, true] },
                    { text: 'Total', style: 'tableHeader', border: [false, false, false, true] }
                ]
            ]
        }
    }

    if (attendancesResume.length === 0) {
        content.table.body.push([
            {
                colSpan: 7,
                text: 'No se registraron asistencias.',
                style: ['tableValue', 'center'],
                border: [false, false, false, true]
            }
        ])
    } else {
        let total = 0

        attendancesResume.forEach((j, index) => {
            content.table.body.push([
                { text: index + 1, style: 'tableValue', border: [false, false, false, true] },
                { text: j.employee, style: 'tableValue', border: [false, false, false, true] },
                { text: '$ ' + numberWithCommas((j.normal_price).toFixed(0)), style: 'tableValue', border: [false, false, false, true] },
                { text: '$ ' + numberWithCommas((j.extra_price).toFixed(0)), style: 'tableValue', border: [false, false, false, true] },
                { text: j.normal_hour, style: ['tableValue', 'center'], border: [false, false, false, true] },
                { text: j.extra_hour, style: ['tableValue', 'center'], border: [false, false, false, true] },
                { text: '$ ' + numberWithCommas((j.total).toFixed(0)), style: 'tableValue', border: [false, false, false, true] }
            ])

            total += j.total
        })

        for (let i = 1; i <= 4; i++) {
            content.table.body.push([
                {
                    colSpan: 7,
                    text: '',
                    style: 'tableValue',
                    border: [false, false, false, false],
                    fillColor: '#f0ffff'
                }
            ])
        }

        content.table.body.push([
            {
                colSpan: 7,
                text: '',
                style: 'tableValue',
                border: [false, false, false, true],
                fillColor: '#f0ffff'
            }
        ])

        // Agrega total final
        content.table.body.push([
            { colSpan: 4, text: '', border: [false, false, false, true] },
            {},
            {},
            {},
            { colSpan: 2, text: 'Total a Pagar', style: ['tableHeader', 'center'], border: [false, false, false, true] },
            {},
            { colSpan: 1, text: '$ ' + numberWithCommas((total).toFixed(0)), style: ['tableValue', 'right', 'bold'], border: [false, false, false, true] }
        ])
    }

    doc.content.push(content)
}

function setAttendances(attendances, doc) {
    doc.content.push({ text: '', style: 'topSpace' })
    doc.content.push({
        text: 'RESUMEN DE ASISTENCIAS',
        style: 'tableTitle'
    })
    doc.content.push({
        style: 'informationBaseline',
        table: {
            widths: [ '*' ],
            heights: [0],
            body: [
                [
                    { text: '', border: [false, false, false, true] }
                ]
            ]
        }
    })

    const content = {
        layout: {
            fillColor: function (rowIndex, node, columnIndex) {
                return (rowIndex !== 0 && rowIndex % 2 === 0) ? '#f5f5f5' : null
            }
        },
        style: 'table',
        table: {
            headerRows: 1,
            widths: [ 'auto', '*', 130, 130, 'auto', 'auto', 'auto' ],
            heights: [15],
            body: [
                [
                    { text: 'Item', style: 'tableHeader', border: [false, false, false, true] },
                    { text: 'Trabajador', style: 'tableHeader', border: [false, false, false, true] },
                    { text: 'Entrada', style: 'tableHeader', border: [false, false, false, true] },
                    { text: 'Salida', style: 'tableHeader', border: [false, false, false, true] },
                    { text: 'Horas N.', style: 'tableHeader', border: [false, false, false, true] },
                    { text: 'Horas E.', style: 'tableHeader', border: [false, false, false, true] },
                    { text: 'Horas', style: 'tableHeader', border: [false, false, false, true] }
                ]
            ]
        }
    }

    if (attendances.length === 0) {
        content.table.body.push([
            {
                colSpan: 5,
                text: 'No se registraron asistencias.',
                style: ['tableValue', 'center'],
                border: [false, false, false, true]
            }
        ])
    } else {
        attendances.forEach((j, index) => {
            content.table.body.push([
                { text: index + 1, style: 'tableValue', border: [false, false, false, true] },
                { text: j.employee, style: 'tableValue', border: [false, false, false, true] },
                { text: j.entry, style: ['tableValue', 'center'], border: [false, false, false, true] },
                { text: j.exit, style: ['tableValue', 'center'], border: [false, false, false, true] },
                { text: j.normal_hour, style: ['tableValue', 'center'], border: [false, false, false, true] },
                { text: j.extra_hour, style: ['tableValue', 'center'], border: [false, false, false, true] },
                { text: j.hours_count, style: ['tableValue', 'center'], border: [false, false, false, true] }
            ])
        })
    }

    doc.content.push(content)
}

function numberWithCommas(x) {
    return x.replace(/\B(?=(\d{3})+(?!\d))/g, ',')
}
